0g) : pâte à beignet garnie d\'une crevette. Pâte à beignet 49% : farine de BLE, eau, OEUF, huile de tournesol, blanc d\'OEUF, poudres à lever : diphosphate disodique et carbonate acide de sodium, amidon de BLE, sel, poivre. CREVETTE (Penaeus spp, élevée en Equateur, Honduras, Inde, Indonésie, Pérou, Thaïlande ou Vietnam) 31,5%. Huile de friture : huile de tournesol. Pourcentages exprimés sur le beignet de crevette. Sauce aigre-douce 40g : eau, sucre, vinaigre d\'alcool, amidon transformé de maïs ou de pomme de terre, purée de piment (piment, sel, vinaigre d\'alcool), sel. Sauce au nuoc mâm 30g : eau, sucre, vinaigre d\'alcool, sel, nuoc mâm 1,6% (POISSON, sel, eau), sauce SOJA (eau, graines de SOJA, sel, farine de BLE). Pourcentage exprimé sur la sauce au nuoc mâm.Certains ingrédients de ce produit ne proviennent pas de France. Traces éventuelles de lait et d\'arachides.', '11', '2.7', '23', '4.6', '2', '5.8', '1.7', '0.669291338582677', '', '0');

